import React from "react";
import books from "../Books";

function Book(props){
    return <div>
    <h3>{props.title}</h3>
    <p>{props.subtitle}</p>
    <p>{props.published}</p>
    <p>{props.author}</p>
    <button type="button" href={props.website}>Know more</button>
    </div>
}
